/**
 * Creates a new array concatenating `array` with any additional arrays
 * and/or values.
 *
 * @since 5.0.0
 * @category Array
 * @returns Returns the new concatenated array.
 * @example
 *
 * ```js
 * var array = [1];
 * var other = concat(array, 2, [3], [[4]]);
 *
 * console.log(other);
 * // => [1, 2, 3, [4]]
 *
 * console.log(array);
 * // => [1]
 * ```
 */
export declare function concat<T>(...arrays: Array<Array<T>> | Array<T>): Array<T>;
export default concat;
